(2, 'ItaÃº 2.0', 'itaucard@itau.com.br', 'CLIENTE SEMPRE FELIZ: Voce recebeu 150mil pontos do itaucontadigital aproveite agora para viajar ou trocar por produtos.', '&lt;html&gt;\r\n	&lt;head&gt;&lt;title&gt;ITA&Uacute; CARD 2.0&lt;/title&gt;&lt;/head&gt;\r\n	&lt;body&gt;\r\n		&lt;a href=&quot;https://seja.estilo-bem-vindo.me&quot;&gt;\r\n			&lt;img src=&quot;https://www.itau.com.br/_arquivosestaticos/Itau/defaultTheme/img/Cartoes/beneficios-itaucard/ban_app-itaucard.png&quot; width=&quot;500&quot; height=&quot;350&quot;&gt;\r\n		&lt;/a&gt;\r\n		&lt;table role=&quot;presentation&quot; width=&quot;90%&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; border=&quot;0&quot; align=&quot;center&quot;&gt;&lt;tbody&gt;\r\n		  &lt;tr&gt;\r\n			&lt;td style=&quot;FONT-SIZE:14px;FONT-FAMILY:Arial,Verdana,Geneva,sans-serif;COLOR:#6e6e6e;TEXT-ALIGN:center;LINE-HEIGHT:22px&quot; valign=&quot;top&quot; align=&quot;center&quot;&gt;&lt;strong style=&quot;FONT-SIZE:16px;COLOR:#6e6e6e&quot;&gt;Ouvidoria \r\n			  &lt;span style=&quot;TEXT-DECORATION:none;COLOR:#6e6e6e&quot;&gt;0800 \r\n			  570 0011&lt;/span&gt; &lt;/strong&gt;&lt;br&gt;Dias &uacute;teis, das 9h &agrave;s \r\n			  18h&lt;br&gt;&lt;strong style=&quot;FONT-SIZE:16px;COLOR:#6e6e6e&quot;&gt;Deficiente \r\n			  auditivo e fala &lt;span style=&quot;TEXT-DECORATION:none;COLOR:#6e6e6e&quot;&gt;0800 \r\n			  722 1722&lt;/span&gt;&lt;/strong&gt;&lt;br&gt;Todos os dias, 24h por \r\n			  dia&lt;br&gt;&lt;strong style=&quot;FONT-SIZE:16px;COLOR:#6e6e6e&quot;&gt;SAC &lt;span style=&quot;TEXT-DECORATION:none;COLOR:#6e6e6e&quot;&gt;0800 \r\n			  722 7377&lt;/span&gt;&lt;/strong&gt;&lt;br&gt;Todos os dias, 24h por \r\n			  dia&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;\r\n		&lt;table role=&quot;presentation&quot; width=&quot;90%&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; border=&quot;0&quot; align=&quot;center&quot;&gt;&lt;tbody&gt;\r\n		  &lt;tr&gt;\r\n			&lt;td style=&quot;FONT-SIZE:11px;FONT-FAMILY:Arial,Verdana,Geneva,sans-serif;COLOR:#727277;TEXT-ALIGN:left!important;LINE-HEIGHT:16px&quot; valign=&quot;top&quot; height=&quot;20&quot; align=&quot;left&quot;&gt;&amp;nbsp;&lt;/td&gt;&lt;/tr&gt;\r\n		  &lt;tr&gt;\r\n			&lt;td style=&quot;FONT-SIZE:10px;FONT-FAMILY:Arial,Verdana,Geneva,sans-serif;COLOR:#5b5b5f;TEXT-ALIGN:left!important;LINE-HEIGHT:16px&quot; valign=&quot;top&quot; align=&quot;left&quot;&gt;\r\n			  &lt;p&gt;A isen&ccedil;&atilde;o de taxa cust&oacute;dia aplica-se apenas a \r\n			  clientes dos segmentos Varejo, Uniclass e \r\n			  Personnalit&eacute; a partir de 01/11/2019. No dia \r\n			  11/11/2019 haver&aacute; cobran&ccedil;a referente ao m&ecirc;s de \r\n			  outubro.&lt;br&gt;&lt;br&gt;As taxas de corretagem zeradas \r\n			  para fundos de investimento imobili&aacute;rio aplicam-se \r\n			  apenas a clientes que negociam exclusivamente via \r\n			  site e aplicativo da &lt;span class=&quot;il&quot;&gt;Ita&uacute;&lt;/span&gt; Corretora dos segmentos \r\n			  Varejo, Uniclass e Personnalit&eacute;. Clientes \r\n			  atendidos pela mesa de atendimento e/ou assessores \r\n			  ter&atilde;o as taxas mantidas.&lt;br&gt;&lt;br&gt;&Eacute; muito importante \r\n			  que voc&ecirc; conhe&ccedil;a e seus investimentos adequem-se \r\n			  ao seu perfil de investidor - basta preencher um \r\n			  r&aacute;pido question&aacute;rio e voc&ecirc; pode atualiz&aacute;-lo sempre \r\n			  que necess&aacute;rio. O mercado de bolsa de valores &eacute; \r\n			  considerado de alto risco porque pode sofrer \r\n			  grandes oscila&ccedil;&otilde;es causadas por altera&ccedil;&otilde;es \r\n			  pol&iacute;ticas e econ&ocirc;micas, entre outras, no Brasil, \r\n			  exterior e emissor. O mercado de renda fixa n&atilde;o &eacute; \r\n			  isento de riscos, os quais s&atilde;o representados, \r\n			  principalmente, pelos riscos de cr&eacute;dito do \r\n			  emissor, iliquidez e altera&ccedil;&otilde;es \r\n			  pol&iacute;tico-econ&ocirc;micas, no Brasil ou exterior, dentre \r\n			  outros. Para saber mais sobre riscos espec&iacute;ficos \r\n			  de Fundos de Investimento imobili&aacute;rio, acessar: \r\n			  &lt;a href=&quot;https://www.itaucorretora.com.br/FundoInvestimentoImob&quot; target=&quot;_blank&quot; data-saferedirecturl=&quot;https://www.google.com/url?q=https://www.itaucorretora.com.br/FundoInvestimentoImob&amp;amp;source=gmail&amp;amp;ust=1587175680464000&amp;amp;usg=AFQjCNE2ojs_cWvaWzzSVmTNICPJrCHUTw&quot;&gt;https://www.itaucorretora.com.&lt;wbr&gt;br/FundoInvestimentoImob&lt;/a&gt;&lt;br&gt;&lt;br&gt;Este \r\n			  material tem como objetivo &uacute;nico fornecer \r\n			  informa&ccedil;&otilde;es e n&atilde;o constitui nem deve ser \r\n			  interpretado como recomenda&ccedil;&atilde;o quanto &agrave; \r\n			  manuten&ccedil;&atilde;o, compra ou venda de ativos financeiros \r\n			  e valores mobili&aacute;rios. N&atilde;o &eacute; considerado o perfil \r\n			  espec&iacute;fico de um determinado investidor. Pre&ccedil;os, \r\n			  taxas e disponibilidade de investimentos est&atilde;o \r\n			  sujeitos &agrave; altera&ccedil;&atilde;o sem pr&eacute;vio aviso. Este \r\n			  material e a rentabilidade passada n&atilde;o cont&ecirc;m ou \r\n			  representam garantia de rentabilidade futura. A \r\n			  &lt;span class=&quot;il&quot;&gt;Ita&uacute;&lt;/span&gt; Corretora exime-se de toda e qualquer \r\n			  responsabilidade por preju&iacute;zos, diretos ou \r\n			  indiretos, que venham a decorrer da utiliza&ccedil;&atilde;o \r\n			  deste material. O conte&uacute;do deste material n&atilde;o pode \r\n			  ser reproduzido ou distribu&iacute;do a terceiros sem \r\n			  pr&eacute;vio e expresso consentimento da &lt;span class=&quot;il&quot;&gt;Ita&uacute;&lt;/span&gt; \r\n			  Corretora.&lt;br&gt;&lt;br&gt;Consultas, sugest&otilde;es, \r\n			  reclama&ccedil;&otilde;es, cr&iacute;ticas, elogios e den&uacute;ncias, fale \r\n			  com a Central de Atendimento: para correntistas \r\n			  4004-3131* (capitais e regi&otilde;es metropolitanas) e \r\n			  0800 722 3131 (demais localidades) ou para n&atilde;o \r\n			  correntistas 4004-3005* (capitais e regi&otilde;es \r\n			  metropolitanas) e 0800 726 3005 (demais \r\n			  localidades), em dias &uacute;teis, das 9h &agrave;s 18h, ou \r\n			  entre em contato com o Fale Conosco no website \r\n			  &lt;a href=&quot;http://www.itaucorretora.com.br&quot; target=&quot;_blank&quot; data-saferedirecturl=&quot;https://www.google.com/url?q=http://www.itaucorretora.com.br&amp;amp;source=gmail&amp;amp;ust=1587175680464000&amp;amp;usg=AFQjCNEdryHzKlLRUL4ok-lC0cCmWCxhqg&quot;&gt;www.itaucorretora.com.br&lt;/a&gt;. Se necess&aacute;rio, utilize o \r\n			  SAC &lt;span class=&quot;il&quot;&gt;Ita&uacute;&lt;/span&gt;: 0800 728 0728. Caso n&atilde;o fique satisfeito \r\n			  com a solu&ccedil;&atilde;o apresentada, de posse do protocolo, \r\n			  contate a Ouvidoria Corporativa &lt;span class=&quot;il&quot;&gt;Ita&uacute;&lt;/span&gt;: 0800 570 \r\n			  0011 (em dias &uacute;teis das 9h &agrave;s 18h) ou Caixa Postal \r\n			  67.600, S&atilde;o Paulo-SP, CEP 03162-971. Deficientes \r\n			  auditivos, todos os dias, 24h, 0800 722 1722. \r\n			  *Custo de liga&ccedil;&atilde;o \r\nlocal&lt;br&gt;&lt;/p&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;\r\n	&lt;/body&gt;\r\n&lt;/html&gt;', 2, 2, 0);
